description:
El juguete en forma de este pez delfín puede nadar en el agua, flotar y puede girar. Es adecuado para acompañar al pequeño en la ducha y ser un compañero de juego de agua emocionante, muy fácil de usar. Simplemente gire la sección de palanca y luego el juguete nadará y circulará el agua moviéndose hacia adelante.

El juguete es muy ahorro de energía, porque no requiere poder batrel, simplemente gire la palanca.


¿cómo Se juega:
-Rotate La sección del jugador bajo cerca de 5x
- Poner en agua
-eliminar Entonces el juguete se nadará solo

-utilizando Material ecológico;
- Ya se reunió EN71 certificado;
- Muy Popular; 
- Tamaño: 10 cm.
